import "./TaskCard.css";
import "../../App.css";
import "../OutlinedButton/OutlinedButton";
import OutlinedButton from "../OutlinedButton/OutlinedButton";
const TaskCard = () => {
    return (
        <div className="containerTaskCard">
            <div className="welcomeText extraLargeText section1">Bun venit, Bildea Cristian!</div>
            <div className="activityText bigText section2">Activitati</div>
            <div className="buttonsActivity section3">
              <OutlinedButton backgroundColor="red" isRounded="true" labelColor="#51557E" />
              <OutlinedButton/>
              <OutlinedButton/>
              <OutlinedButton/>
              <OutlinedButton/>
            </div>
        </div>
    );
}

export default TaskCard;
